window.addEventListener('swal', detail => {
    Swal.fire({
        title: detail.detail.title,
        text: detail.detail.text,
        type: detail.detail.type,
        confirmButtonClass: "btn btn-primary",
        timer: typeof detail.detail.timer === 'undefined' ? '10e3' :  `${detail.detail.timer}e3`,
        buttonsStyling: !1,
    })
})
